import React from "react";

class ListaMensagens extends React.Component {
  render() {
    console.log("Lista de mensagens", this.props.mensagens);
    return (
      <div>
        {this.props.mensagens.map((mensagem) => {
          return <p>{mensagem}</p>;
        })}
      </div>
    );
  }
}

export default ListaMensagens;
